import React, { Component } from 'react'
import { DatePicker, InputNumber  } from 'antd';
import 'antd/dist/antd.css'
import './index.css'

export default class Input extends Component {
    render() {
        return (
            <div>
                <form action="">
                    选择某一天的注射点存储疫苗： <DatePicker/><br/>
                    <h4>请输入各注射点想要储存的疫苗量：</h4>
                    注射点1：<InputNumber min={1} max={100000} defaultValue={1000}/> <button>存入</button> <br/>
                    注射点2：<InputNumber min={1} max={100000} defaultValue={1000}/> <button>存入</button><br/>
                    注射点3：<InputNumber min={1} max={100000} defaultValue={1000}/> <button>存入</button><br/>
                    注射点4：<InputNumber min={1} max={100000} defaultValue={1000}/> <button>存入</button><br/>
                    这天总共存储了？？支疫苗
                </form>
            </div>
        )
    }
}
